package cz.smycka.example.data

import kotlinx.coroutines.delay
import javax.inject.Inject

class FakePictureDataSource @Inject constructor() : PictureDataSource {

    override suspend fun loadImage(userName: String, password: String): LoadResult<String> {
        delay(800L)
        return when(userName) {
            "success" -> LoadResult.Success(PICTURE)
            "wrongp" -> LoadResult.Unauthorized
            else -> LoadResult.Failed
        }
    }
}

private const val PICTURE = ""